package com.Practice.corejava;

public class SwapPojo {
	
	private int a = 0;
	
	private int b = 0;
	
	public SwapPojo(int a, int b) {
		// TODO Auto-generated constructor stub
		this.a = a;
		this.b = b;
	}

	public int getA() {
		return a;
	}

	public void setA(int a) {
		this.a = a;
	}

	public int getB() {
		return b;
	}

	public void setB(int b) {
		this.b = b;
	}
	
	

}
